    //                         }}
    //                 ).then(console.log('ыфв'))
    //             }).then(function(response) {
    //                 return response.json();
    //             }).then(function(answer) {
    //                 return pc.setRemoteDescription(answer);
    //             }).catch(function(e) {
    //                 alert(e);
    //             });
    //         }).catch((err) => {
    //             setError(err.name);
    //         })
    //
    // }
